DECLARE @NT GEOGRAPHY = @geom.MakeValid().STUnion(@geom.STStartPoint()).STAsText();
DECLARE @NTLocalGovernmentAreas GEOGRAPHY;

SELECT @NTLocalGovernmentAreas = geography::UnionAggregate( Area.MakeValid() ) 
FROM [Location].LocalGovernmentArea
WHERE StateID=3 AND Name <> 'NT Balance';

UPDATE [Location].LocalGovernmentArea
SET Area = @NT.STDifference(@NTLocalGovernmentAreas)
WHERE StateID=3 and Name = 'NT Balance';


UPDATE [Location].LocalGovernmentArea
SET Area = @NT.STDifference(@NTLocalGovernmentAreas)
WHERE StateID=3 and Name = 'NT Balance';